import React, {useState,useEffect} from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from 'react';
import Trader from "./components/trader";

function App (){

  const [data,setData] = useState([{}])
  useEffect(()=>{
      fetch("/mem").then(
          res=>res.json() 
      ).then(
        data => {
          setData(data.memvers)
          console.log(data)
        }
      )
  },[])
        return (
          <Routes>
          <Route exact path='/' element={< Trader />}></Route>

   </Routes>

        )
}

export default App;
